import React from "react";
import {
  Pie,
  PieChart,
  Tooltip,
  CartesianGrid,
  Legend,
  XAxis,
  YAxis
} from "recharts";

const data = [
  {
    "name": "AMD",
    "value": 2400
  },
  {
    "name": "NVDA",
    "value": 4567
  },
  {
    "name": "EBAY",
    "value": 1398
  },
  {
    "name": "AAPL",
    "value": 9800
  },
  {
    "name": "",
    "value": 3908
  },
  {
    "name": "Group F",
    "value": 4800
  }
];

const colours = ['#0088FE', '#00C49F', '#FFBB28', '#FF8042'];

class Portfoliochart extends React.Component {
  render() {
    return (
      <PieChart width={730} height={250}>
        <Tooltip />
        <Pie
          data={data}
          dataKey="value"
          nameKey="name"
          cx="50%"
          cy="50%"
          innerRadius={60}
          outerRadius={80}
          paddingAngle={5}
          fill="#006fff"
          label
        />
      </PieChart>
    );
  }
}

export default Portfoliochart;
